import { Link } from "react-router-dom";

function ProfEntryCard(props) {
    return (
        <li id="job">
            <Link to={{
            pathname: `/professor-CR?professor_name=${props.profName}`,
            }}>
                <div>
                    <h3>Professor Name: { props.profName }; Title: {props.profTitle}; Email Address: {props.profEmail}</h3>
                </div>
            </Link>
        </li>
    );
  }

  export default ProfEntryCard;
